import React from "react";
import "../styles/QRcode.css";

export default function QRCode(props) {
  console.log(props);
  return (
    <section className="QRcode">
      <div className="QR-code">
        <img src="./image.png" alt="" />
        <p>123</p>
        <p>3333</p>
      </div>
    </section>
  );
}
